import Button from "../components/Button";
import { Container, Row, Col } from "react-grid-system";

function Hero() {
    return <Container>
        <Row>
            <Col xs={12}>
                <div>
                    <Button className="mr-2">Mortgage Relief</Button>
                    <Button disabled={true} tooltip="Coming soon">Small Business Aid</Button>
                </div>
            </Col>
        </Row>
    </Container>
}

export default Hero;
